import React,{useState} from 'react';
import {Link,Redirect} from 'react-router-dom';
import {Box, Grommet,Button,Heading,Text,Grid} from 'grommet';
import '../App.css';

function Ai() {
    

    return (
        <>
            <Box height={{max:"700px",min:"auto"}} width="xxlarge" background="white" pad="large" gap="medium" direction="column" justify="center" align="center" >
                <Box width="100%"  direction="row-responsive" justify="end" alignSelf="center" >
                    <Box width="233px" height={{max:"94px",min:"94px"}} background="#1AA15F" justify="center" align="center">
                    <Heading margin="none" level="5" color="white">Research & Solutions </Heading>

                    </Box>
                    <Box width="233px" height={{max:"94px",min:"94px"}} onClick={()=> console.log("clicked")} background="white" justify="center" align="center">
                    <Heading margin="none" level="5" color="black">Design & Strategy </Heading>

                    </Box>
                    <Box width="233px" height={{max:"94px",min:"94px"}} background="white" justify="center" onClick={()=> console.log("clicked")} align="center">
                    <Heading margin="none" level="5" color="black">Artificial Intelligence </Heading>

                    </Box>
                    <Box width="233px" height={{max:"94px",min:"94px"}} background="white" justify="center" onClick={()=> console.log("clicked")} align="center">
                    <Heading margin="none" level="5" color="black">Cloud Deployment </Heading>

                    </Box>
                    




                </Box>
                
            </Box>
        </>
    )
}
export default Ai;
